import React from 'react';
import { atom } from "recoil";

// 컴포넌트에서 아톰을 사용하기 위해 export를 사용해 내보냅니다.
export const userLogin = atom({
    key: "userLogin",
    default: 0
})

function Enter(onChange) {
    return (
     <>
         <div className="enter_wrap">
            <input className="enter_input" placeholder="아이디를 입력하세요" onChange={onChange}/>
             <input className="enter_input" placeholder="비밀번호를 입력하세요" onChange={onChange}/>
             <button className="enter_btn">로그인</button>
         </div>
     </>
    )
}
export default Enter;
